import React from 'react'
import images from '../Helpers/Images'

function Carousel() {
  return (
    <div className='h-96'>
      <div className='h-96'
      style={{ background: `url(${images[1].img})`, backgroundSize: 'cover' }}></div>
    </div>
  )
}

export default Carousel
